import {Link} from "react-router-dom";

function Home() {
    return (
        <div className="container">
            <div align="center">
                <Link to="/">Home</Link>
                <Link to="/Cadastro">Cadastro</Link>
                <Link to="/financiamento">Financiamento</Link>
                <Link to="/Movimentacao">Movimentção</Link>
                <Link to="/Sobrenos">Sobre Nós</Link>
                <hr/>
                <h1>Home</h1>
            </div>
        </div>
    );
}

export default Home;
